import React from 'react';
import '../../App.css';
import LocalDate from '../LocalDate';
import Cards from '../Cards';
import Footer from '../Footer';
import Banner from '../Banner';



function Home() {
  return (
    <>
      <Banner />
      <LocalDate />
      <Cards />
      <Footer />
    </>
  );
}

export default Home;
